import {
  createBrowserRouter,
  RouterProvider,
  Route,
} from "react-router-dom";

// Creating the routes
const router = createBrowserRouter([
  {
    // Home page route
    path:"/",
    element:<span>Home</span>
  },
  {
    // Products page route
    path:"/products/:id",
    element:<span>Category</span>
  },
  {
    // Particular Product page route
    path:"/product/:id",
    element:<span>Product</span>
  },

])

function App() {
  return (
    <div>
      <RouterProvider router={router}/>
    </div>
  );
}

export default App;
